  const tags = ["All", "UI", "UX", "Enhancement", "Bug", "Feature"];

  return (
    <article className={styles.tags}>
      {tags.map((tag, index) => (
        <Tag key={index}>{tag}</Tag>
      ))}
    </article>
  );
}
